import React from 'react';
import Alisson from "./ali.jpeg"
import likeHeart from './navbar-heart.png';


class Card extends React.Component {
    render() {
      return (
        <div className="card">
        <div>
        <img src={Alisson} alt="alisson" height="500px" width="500px"/>
        <button class="far fa-heart">
            <span class="far fa-heart" aria-label="Like"></span>
        </button>
        </div>
        </div>

      )
    }
  }
  export default Card;
